(732, 'es', 'Widgets', 'widget body - 420867fb8d6095ccb79c422db6718d40', 'Nuestra pensión, situada en pleno centro de Madrid junto a la Gran Vía al lado de Chueca cuenta con habitaciones sencillas y dobles, con posibilidad de supletoria, baño, wifi, calefacción, aire acondicionado, televisión, etc.\r\n\r\nUn lugar tranquilo donde hospedarte en Madrid, cerca de museos, zonas de diversión, teatros y zonas de compras muy bien comunicada con con estaciones de metro y autobus.\r\n', 0),
