(728, 'es', 'Success Message', '9c01fd5def35fd402ef6f7ebd481b007', 'Enhorabuena, tu reserva se realizó con éxito!\r\nSu reserva sólo está a falta de confirmación telefónica\r\nLlame al 91 531 73 89\r\n\r\nCongratulation, your book room online successfully!\r\nyour reservation must be confirmed by phone\r\nCall us to 91 531 73 89.', 0),
(729, 'es', 'Cash Success Message', '982707d43556a086bf8a0d2d2520bcf8', 'Enhorabuena, tu reserva se realizó con éxito!\r\nSu reserva sólo está a falta de confirmación telefónica\r\nLlame al 91 531 73 89\r\n\r\nCongratulation, your book room online successfully!\r\nyour reservation must be confirmed by phone\r\nCall us to 91 531 73 89', 0),
(730, 'es', 'Widgets', 'widget body - 17fce8929b96c7e38a61b4bd02de2c66', '<p>Teléfono: +34 91 531 73 89</p><br />\r\n<p>Dirección: C/ Fuencarral, 27 Plt. 2, Madrid 28004 </p><br />\r\n<p>E-mail: pensionadeco@hotmail.com</p>\r\n', 1),
(731, 'es', 'Widgets', 'widget body - 995d0f225d8126fa766a0fe7abb8b1f5', '<p>Conoce nuestro alojamiento: ADECO 2   En la calle Gaztambide (Zona Moncloa)</p><br />\r\n<p>web: <a href="http://www.alojamientoadecodos.com" target="_blank">www.alojamientoadecodos.com</a></p>\r\nReservas  +34 91 544 70 08\r\n', 1),
(733, 'es', 'Widgets', 'widget body - 1fb2da8d234ae3fa3062ce290961dc6e', 'Nuestra pensión, situada en pleno centro de Madrid junto a la Gran Vía al lado de Chueca cuenta con habitaciones sencillas y dobles, con posibilidad de supletoria, baño, wifi, calefacción, aire acondicionado, televisión, etc.\r\n\r\nUn lugar tranquilo donde hospedarte en Madrid, cerca de museos, zonas de diversión, teatros y zonas de compras, muy bien comunicada con con estaciones de metro y autobús.', 0),
(734, 'es', 'Widgets', 'widget body - 0c7ec66a0a89547c3737ab1cc0da37a4', '<p>Para reservas contacta con nosotros a través de:</p>\r\n<p>- Teléfono: +34 91 531 73 89</p>\r\n<br />\r\n<p>- E-mail: pensionadeco@hotmail.com</p><br>\r\n<p>- Dirección: C/ Fuencarral, 27 Plt. 2, Madrid 28004 </p>', 0),
(735, 'es', 'Widgets', 'widget body - 0f4cb0a35a6a258782044a18be94028a', '<p>Conoce nuestro alojamiento: ADECO 2   En la calle Gaztambide (Zona Moncloa)</p><br />\r\n<p>web: <a href="http://www.alojamientoadecodos.com" target="_blank">www.alojamientoadecodos.com</a></p>\r\nReservas  +34 91 544 70 08', 0),
(736, 'es', 'Widgets', 'widget body - fa4ccc904bc822dd7e6bdf1486c75d00', '<p>Para reservas contacta con nosotros a través de:</p><br>\r\n<p>- Teléfono: +34 91 531 73 89</p>\r\n<p>- E-mail: pensionadeco@hotmail.com</p>\r\n<p>- Dirección: C/ Fuencarral, 27 Plt. 2, Madrid 28004 </p>', 0),
(737, 'es', 'Widgets', 'widget body - 3bcc573452894c633e7839d8f37ea987', 'Nuestra pensión, situada en pleno centro de Madrid junto a la Gran Vía al lado de Chueca cuenta con habitaciones sencillas y dobles, con posibilidad de supletoria, baño, wifi, calefacción, aire acondicionado, televisión, etc.\r\n\r\nUn lugar tranquilo donde hospedarte en Madrid, cerca de museos, zonas de diversión, teatros y zonas de compras, muy bien comunicada con  estaciones de metro y autobús.', 0);
