(1, 6, 'de', 1, 'Unsere Pension, die im Zentrum Madids liegt, ist ein bequems und ruhiges  Haus, bestens mit dem Flughafem verbunden. Ganz in der Nähe von inserer Pension befinfen sich die U-Bahnhaltesetellen “Metro Tribunal” und “Metro Gran Vía”, S-Bahnhaltesetellen und vielen Bushaktestellen.\r\n\r\nSie liegt in der Nähe von Einkaufsstra ßen, von kulturellem und touristuchem Zonen (der Pinakothek), und von Malasaña, Huertas, Chueca und Diskos wie Pachá, Joy Eslava und Capital.\r\n', NULL, '2013-09-27 09:53:16'),
(2, 6, 'fr', 1, 'Notre pension, située en plain centre de Madrid, c’est une maison calme et confortable. De rapide accès avex l’aéroport, les gares, les bus. Proche au métro Tribunal et Gran Vía.\r\n\r\nA coté de zones comerciales, de intérêt culturelle et touristique (principales musées), areas d’ambiance et distraction (Malasannia, Huertas, Chueca) et discos comment “Pacha”, “Joy Eslava” et “Capital”.\r\n', NULL, '2013-09-27 09:53:19'),
(3, 6, 'en', 1, 'Our inn, located in the very center of Madrid, is a house tranquil and comfortable, closet o tren stations, buses and the subway stations of Tribunal and Gran Vía, as well as a very fast and easy commuting to the airport.\r\n\r\nIt is close to a lot of commercial areas, of cultural and touristis interest, (main museums), as well as close to areas of amusement and diversion like Malasana, Huertas, Chueca and discoteques as Pacha, Joy Eslava and Capital.\r\n', NULL, '2013-09-27 09:53:22'),
