(200, 'widget_content', 'a:5:{i:2;a:3:{s:5:"title";s:14:"Pensión Adeco";s:8:"titlesub";s:0:"";s:7:"content";s:403:"Nuestra pensión, situada en pleno centro de Madrid junto a la Gran Vía al lado de Chueca cuenta con habitaciones sencillas y dobles, con posibilidad de supletoria, baño, wifi, calefacción, aire acondicionado, televisión, etc.\r\n\r\nUn lugar tranquilo donde hospedarte en Madrid, cerca de museos, zonas de diversión, teatros y zonas de compras, muy bien comunicada con  estaciones de metro y autobús.";}i:3;a:3:{s:5:"title";s:9:"Contacto ";s:8:"titlesub";s:0:"";s:7:"content";s:203:"<p>Para reservas contacta con nosotros a través de:</p><br>\r\n<p>- Teléfono: +34 91 531 73 89</p>\r\n<p>- E-mail: pensionadeco@hotmail.com</p>\r\n<p>- Dirección: C/ Fuencarral, 27 Plt. 2, Madrid 28004 </p>";}i:4;a:3:{s:5:"title";s:7:"Adeco 2";s:8:"titlesub";s:0:"";s:7:"content";s:222:"<p>Conoce nuestro alojamiento: ADECO 2   En la calle Gaztambide (Zona Moncloa)</p><br />\r\n<p>web: <a href="http://www.alojamientoadecodos.com" target="_blank">www.alojamientoadecodos.com</a></p>\r\nReservas  +34 91 544 70 08";}i:5;a:3:{s:5:"title";s:16:"Aviso importante";s:8:"titlesub";s:0:"";s:7:"content";s:99:"<p>Si no puede reservas online llámanos al 915317389</p>\r\n<p>Nuestros precios son orientativos</p>";}s:12:"_multiwidget";i:1;}', 'yes'),
