(11, 4, '2013-09-25 16:21:45', '2013-09-25 16:21:45', '<img class="alignleft size-full wp-image-121" alt="Pensión Adeco" src="http://pensionadeco.com/wp-content/uploads/2013/09/pension-adeco.png" width="184" height="251" />Nuestra pensión, situada en pleno centro de Madrid es una casa confortable y tranquila, de rápida y fácil comunicación con el Aeropuerto, las estaciones de tren, números autobuses y cercana a las paradas de Metro de Tribunal y Gran Vía.\r\n\r\nEstá próxima a zonas comerciales, de interés cultural y turístico (Principales Museos), zonas de marcha y diversión como Malasaña, Huertas, Chueca y Discotecas como Pachá, Joy Eslava y Capital.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Nosotros', '', 'publish', 'closed', 'closed', '', 'nosotros', '', '', '2013-09-27 08:55:26', '2013-09-27 08:55:26', '', 0, 'http://pensionadeco.com/?page_id=11', 0, 'page', '', 0),
