(118, 4, '2013-09-25 18:51:39', '2013-09-25 18:51:39', '<p>Nuestra pensión, situada en pleno centro de Madrid es una casa confortable y tranquila, de rápida y fácil comunicación con el Aeropuerto, las estaciones de tren, números autobuses y cercana a las paradas de Metro de Tribunal y Gran Vía. Está próxima a zonas comerciales, de interés cultural y turístico (Principales Museos), zonas de marcha y diversión como Malasaña, Huertas, Chueca y Discotecas como Pachá, Joy Eslava y Capital.</p>', 'Nosotros', '', 'inherit', 'open', 'open', '', '11-revision-v1', '', '', '2013-09-25 18:51:39', '2013-09-25 18:51:39', '', 11, 'http://pensionadeco.com/11-revision-v1/', 0, 'revision', '', 0),
