(207, 4, '2013-09-25 16:21:45', '2013-09-25 16:21:45', '<img class="alignleft size-full wp-image-121" alt="Pensión Adeco" src="http://pensionadeco.com/wp-content/uploads/2013/09/pension-adeco.png" width="184" height="251" />Notre pension, située en plain centre de Madrid, c’est une maison calme et confortable. De rapide accès avex l’aéroport, les gares, les bus. Proche au métro Tribunal et Gran Vía.\r\n\r\nA coté de zones comerciales, de intérêt culturelle et touristique (principales musées), areas d’ambiance et distraction (Malasannia, Huertas, Chueca) et discos comment “Pacha”, “Joy Eslava” et “Capital”.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Nous', '', 'publish', 'closed', 'closed', '', 'nosotros', '', '', '2013-09-27 09:31:27', '2013-09-27 09:31:27', '', 0, 'http://pensionadeco.com/about-us-3/', 0, 'page', '', 0),
(225, 4, '2013-09-27 08:57:21', '2013-09-27 08:57:21', '<img class="alignleft size-full wp-image-121" alt="Pensión Adeco" src="http://pensionadeco.com/wp-content/uploads/2013/09/pension-adeco.png" width="184" height="251" />\r\n\r\nNotre pension, située en plain centre de Madrid, c’est une maison calme et confortable. De rapide accès avex l’aéroport, les gares, les bus. Proche au métro Tribunal et Gran Vía.\r\n\r\nA coté de zones comerciales, de intérêt culturelle et touristique (principales musées), areas d’ambiance et distraction (Malasannia, Huertas, Chueca) et discos comment “Pacha”, “Joy Eslava” et “Capital”.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Nosotros', '', 'inherit', 'open', 'open', '', '207-revision-v1', '', '', '2013-09-27 08:57:21', '2013-09-27 08:57:21', '', 207, 'http://pensionadeco.com/207-revision-v1/', 0, 'revision', '', 0),
(220, 4, '2013-09-27 08:55:27', '2013-09-27 08:55:27', '<img class="alignleft size-full wp-image-121" alt="Pensión Adeco" src="http://pensionadeco.com/wp-content/uploads/2013/09/pension-adeco.png" width="184" height="251" />Nuestra pensión, situada en pleno centro de Madrid es una casa confortable y tranquila, de rápida y fácil comunicación con el Aeropuerto, las estaciones de tren, números autobuses y cercana a las paradas de Metro de Tribunal y Gran Vía.\r\n\r\nEstá próxima a zonas comerciales, de interés cultural y turístico (Principales Museos), zonas de marcha y diversión como Malasaña, Huertas, Chueca y Discotecas como Pachá, Joy Eslava y Capital.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Nosotros', '', 'inherit', 'open', 'open', '', '207-revision-v1', '', '', '2013-09-27 08:55:27', '2013-09-27 08:55:27', '', 207, 'http://pensionadeco.com/207-revision-v1/', 0, 'revision', '', 0),
(208, 4, '2013-09-25 16:21:45', '2013-09-25 16:21:45', '<img class="alignleft size-full wp-image-121" alt="Pensión Adeco" src="http://pensionadeco.com/wp-content/uploads/2013/09/pension-adeco.png" width="184" height="251" />Unsere Pension, die im Zentrum Madids liegt, ist ein bequems und ruhiges  Haus, bestens mit dem Flughafem verbunden. Ganz in der Nähe von inserer Pension befinfen sich die U-Bahnhaltesetellen “Metro Tribunal” und “Metro Gran Vía”, S-Bahnhaltesetellen und vielen Bushaktestellen.\r\n\r\nSie liegt in der Nähe von Einkaufsstra ßen, von kulturellem und touristuchem Zonen (der Pinakothek), und von Malasaña, Huertas, Chueca und Diskos wie Pachá, Joy Eslava und Capital.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Uns', '', 'publish', 'closed', 'closed', '', 'nosotros', '', '', '2013-09-27 09:30:57', '2013-09-27 09:30:57', '', 0, 'http://pensionadeco.com/about-us-3/', 0, 'page', '', 0),
