(224, 4, '2013-09-27 08:57:04', '2013-09-27 08:57:04', '<img class="alignleft size-full wp-image-121" alt="Pensión Adeco" src="http://pensionadeco.com/wp-content/uploads/2013/09/pension-adeco.png" width="184" height="251" />\r\n\r\nUnsere Pension, die im Zentrum Madids liegt, ist ein bequems und ruhiges  Haus, bestens mit dem Flughafem verbunden. Ganz in der Nähe von inserer Pension befinfen sich die U-Bahnhaltesetellen “Metro Tribunal” und “Metro Gran Vía”, S-Bahnhaltesetellen und vielen Bushaktestellen.\r\n\r\nSie liegt in der Nähe von Einkaufsstra ßen, von kulturellem und touristuchem Zonen (der Pinakothek), und von Malasaña, Huertas, Chueca und Diskos wie Pachá, Joy Eslava und Capital.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Nosotros', '', 'inherit', 'open', 'open', '', '208-revision-v1', '', '', '2013-09-27 08:57:04', '2013-09-27 08:57:04', '', 208, 'http://pensionadeco.com/208-revision-v1/', 0, 'revision', '', 0),
(226, 4, '2013-09-27 08:58:03', '2013-09-27 08:58:03', '<img class="alignleft size-full wp-image-121" alt="Pensión Adeco" src="http://pensionadeco.com/wp-content/uploads/2013/09/pension-adeco.png" width="184" height="251" />\r\n\r\nNotre pension, située en plain centre de Madrid, c’est une maison calme et confortable. De rapide accès avex l’aéroport, les gares, les bus. Proche au métro Tribunal et Gran Vía.\r\n\r\nA coté de zones comerciales, de intérêt culturelle et touristique (principales musées), areas d’ambiance et distraction (Malasannia, Huertas, Chueca) et discos comment “Pacha”, “Joy Eslava” et “Capital”.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Nous', '', 'inherit', 'open', 'open', '', '207-revision-v1', '', '', '2013-09-27 08:58:03', '2013-09-27 08:58:03', '', 207, 'http://pensionadeco.com/207-revision-v1/', 0, 'revision', '', 0),
