INSERT INTO `wp__wsd_plugin_alerts` (`alertId`, `alertType`, `alertSeverity`, `alertActionName`, `alertTitle`, `alertDescription`, `alertSolution`, `alertDate`, `alertFirstSeen`) VALUES
(1, 0, 3, 'fix_wp_version_hidden', 'WordPress version is displayed for all users', '<p>Displaying your WordPress version on frontend and in the backend''s footer to all visitors\r\n                        and users of your website is a security risk because if a hacker knows which version of WordPress a website is running, it can make it easier for him to target a known WordPress security issue.</p>', '<p>This plugin can automatically hide your WordPress version from frontend, backend and rss feeds if the option <strong>"Hide WordPress version for all users but administrators"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(2, 0, 3, 'fix_wp_generators_frontend', 'WordPress meta tags are displayed on frontend to all users', '<p>By default, WordPress creates a few meta tags, among which is the currently installed version, that give a hacker the knowledge about your WordPress installation. At the moment, these meta tags are available for anyone to see, which is a potentially security risk.</p>', '<p>This plugin can automatically hide your WordPress''s default meta tags if the option <strong>"Remove various meta tags generators from the blog''s head tag for non-administrators"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(3, 0, 0, 'fix_wp_rsd_frontend', 'WordPress Really Simple Discovery tag is displayed on frontend to all users', '<p>By default, WordPress creates the <strong>rsd meta tag</strong> to allow bloggers to consume services like Flickr using the <a href="http://en.wikipedia.org/wiki/XML-RPC" target="_blank">XML-RPC</a> protocol.\r\n                            If you don''t use such services it is recommended to hide this meta tag.</p>', '<p>This plugin can automatically hide the rsd meta tag if the option <strong>"Remove Really Simple Discovery meta tags from front-end"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(4, 0, 2, 'fix_wp_wlw_frontend', 'WordPress Windows Live Writer tag is displayed on frontend for all users', '<p>By default, WordPress creates the wlw meta tag to allow bloggers to publish their articles using the <strong>"Windows Live Writer"</strong> application.\r\n                        It is recommended to hide this meta tag from all visitors. If the option <strong>"Remove Windows Live Writer meta tags from front-end"</strong> is checked on the plugin''s settings page, this meta tag\r\n                        will still be available for administrator users to use the <strong>"Windows Live Writer"</strong> application to publish their blog posts.</p>', '<p>This plugin can automatically hide the wlw meta tag if the option <strong>"Remove Windows Live Writer meta tags from front-end""</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(5, 0, 3, 'fix_wp_error_reporting', 'The check for PHP and database error reporting is disabled', '<p>By default, WordPress hides database errors, but there are times when a plugin might enable them thus it is very important to have this type of errors turned off\r\n                            so if there is an error during a connection to the database the user will not get access to the error message generated during that request.</p>\r\n                            <p>As regarding the PHP errors, with the <strong>display_error</strong> PHP configuration directive enabled, untrusted sources can see detailed web application environment\r\n                            error messages which include sensitive information that can be used to craft further attacks.</p>\r\n                            <p>Attackers will do anything to collect information in order to design their attack in a more sophisticated way to eventually hack your website or web application, and causing\r\n                            errors to display is a common starting point. Website errors can always occur, but they should be suppressed from being displayed back to the public.</p>\r\n                            <p>Therefore we highly recommend you to have the <strong>"Disable error reporting (php + db) for all but administrators"</strong> option checked on the plugin''s settings page to ensure PHP and\r\n                            database errors will be hidden from all users. For more information, please check the following <a href="http://www.acunetix.com/blog/web-security-zone/articles/php-security-directive-your-website-is-showing-php-errors/" target="_blank">article</a>.</p>', '<p>This plugin can do this automatically if the option <strong>"Disable error reporting (php + db) for all but administrators"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(6, 0, 3, 'fix_wp_core_update_notif', 'Core update notifications are displayed to all users', '<p>These notifications are displayed at the top of the screen by the WordPress platform whenever the website was updated or needs an update.</p>\r\n                    <p>These notifications should only be viewed by the website''s administrators and not visible to any other users registered with that website.</p>', '<p>This plugin can automatically hide these notifications if the option <strong>"Remove core update notifications from back-end for all but administrators"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(7, 0, 2, 'fix_wp_plugins_update_notif', 'Plugins update notifications are displayed to all users', '<p>These notifications are displayed at the top of the screen by the WordPress platform whenever the blog administrator\r\n                        needs to be informed about an available update for a plugin.</p>\r\n                    <p>These notifications should only be viewed by the website''s administrators and not visible to any other users registered with that website.</p>', '<p>This plugin can automatically hide these notifications if the option <strong>"Remove plug-ins update notifications from back-end"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(8, 0, 0, 'fix_wp_themes_update_notif', 'Themes update notifications are displayed to all users.', '<p>These notifications are displayed at the top of the screen by the WordPress platform whenever the blog administrator\r\n                        needs to be informed about an available update for a theme.</p>\r\n                    <p>These notifications should only be viewed by the website''s administrators and not visible to any other users registered with that website.</p>', '<p>This plugin can automatically hide these notifications if the option <strong>"Remove themes update notifications from back-end"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(9, 0, 2, 'fix_wp_login_errors', 'WordPress login errors are displayed.', '<p>Every time a failed login is encountered, the WordPress platform generates an error message that is displayed to the user.\r\n                        This is a potential security risk because it let''s the user know of his mistake (be it a wrong user name or password) thus making your\r\n                        WordPress website more vulnerable to attacks.</p>\r\n                    <p>We strongly recommend you to hide these login error messages from all users to ensure a better security of your blog.</p>', '<p>This plugin can automatically hide these notifications if the option <strong>"Remove login error notifications from front-end"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(10, 0, 2, 'fix_wp_admin_notices', 'WordPress admin notifications are displayed to all users.', '<p>These notifications are displayed at the top of the screen by the WordPress platform whenever the blog administrator\r\n                       needs to be informed about an event that has occurred inside WordPress, it could be about an available update for the\r\n                       WordPress platform, a plugin or a theme that was updated or needs an update or to be configured, etc.</p>\r\n                    <p>These notifications should only be viewed by the website''s administrators and not visible to any other users registered with that website.</p>', '<p>This plugin can automatically hide these notifications if the option <strong>"Hide admin notifications for non admins"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(11, 0, 2, 'fix_wp_dir_listing', 'Directory listing check is disabled. This option should be enabled.', '<p>A directory listing provides an attacker with the complete index of all the resources located inside of the directory.\r\n                    The specific risks and consequences vary depending on which files are listed and accessible.\r\n                    Therefore, it is important to protect your directories by having an empty index.php or index.htm file inside them.</p>', '<p>This plugin can automatically create an empty <strong>index.php</strong> file in the following directories: wp-content, wp-content/plugins, wp-content/themes and wp-content/uploads if\r\n                    the option <strong>"Try to create the index.php file in the wp-content, wp-content/plugins, wp-content/themes and wp-content/uploads directories to prevent directory listing"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(12, 0, 3, 'fix_remove_wp_version_links', 'WordPress version is displayed in links for all users', '<p>By default, WordPress will display the current version in links to javascript scripts or stylesheets.\r\n                    Therefore, if anyone has access to this information it might be a security risk because if a hacker knows which version of WordPress a website is running,\r\n                    it can make it easier for him to target a known WordPress security issue.</p>', '<p>This plugin can automatically hide the WordPress version from links if the option <strong>"Remove the version parameter from urls"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(13, 0, 2, 'fix_empty_root_readme_file', 'Clearing the content of the <strong>"readme.html"</strong> file from the <strong>"root"</strong> directory is disabled.', '<p>A default WordPress installation contains a readme.html file. This file is a simple html file that does not contain executable content that can be exploited by hackers or malicious users.\r\n                        Still, this file can provide hackers the version of your WordPress installation, therefore it is important to either delete this file or make it inaccessible for your visitors.</p>', '<p>This plugin can automatically delete its content (assuming the file exists) if the option <strong>"Empty the content of the readme.html file from the root directory"</strong> is checked on the plugin''s settings page.\r\n                    You can also delete this file manually by connecting to your website through an FTP connection.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(14, 0, 3, 'check_table_prefix', 'The default WordPress database prefix (<strong>wp_</strong>) is used', '<p>The majority of reported WordPress database security attacks were performed by exploiting SQL Injection vulnerabilities.\r\n                        By renaming the WordPress database table prefixes you are securing your WordPress blog and website from zero day SQL injections attacks.</p>\r\n                    <p>Therefore by renaming the WordPress database table prefixes, you are automatically enforcing your WordPress database security against such dangerous attacks\r\n                        because the attacker would not be able to guess the table names.</p>\r\n                    <p>We recommend to use difficult to guess prefixes, like long random strings which include both letters and numbers.</p>', '<p>This plugin can automatically <a href="admin.php?page=wsd_database">do this</a> for you, but if you want to do it manually then please read this <a href="http://www.websitedefender.com/wordpress-security/change-wordpress-database-prefix/" target="_blank">article</a> first.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(15, 0, 0, 'check_wp_current_version', 'You have the latest version of WordPress installed', '<p>The latest WordPress version is usually more stable and secure, and is only released to include new features or fix technical and WordPress security bugs;\r\n                            making it an important part of your website administration to keep up to date since some fixes might resolve security issues.<p>\r\n                        <p>Running an older WordPress version could put your blog security at risk, allowing a hacker to exploit known vulnerabilities for your specific version and take full control over your web server.</p>', '', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(16, 0, 0, 'check_index_wp_content', 'The <strong>"index.php"</strong> file was found in the <strong>"/wp-content"</strong> directory', '<p>A directory listing provides an attacker with the complete index of all the resources located inside of the directory. The specific risks and consequences vary depending on which files are listed and accessible.</p>\r\n                    <p>Therefore, it is important to protect your directories by having an empty index.php or index.htm file inside them.</p>', '', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(17, 0, 0, 'check_index_wp_plugins', 'The <strong>"index.php"</strong> file was found in the <strong>"/wp-content/plugins"</strong> directory', '<p>A directory listing provides an attacker with the complete index of all the resources located inside of the directory. The specific risks and consequences vary depending on which files are listed and accessible.</p>\r\n                    <p>Therefore, it is important to protect your directories by having an empty index.php or index.htm file inside them.</p>', '', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(18, 0, 0, 'check_index_wp_themes', 'The <strong>"index.php"</strong> file was found in the <strong>"/wp-content/themes"</strong> directory', '<p>A directory listing provides an attacker with the complete index of all the resources located inside of the directory. The specific risks and consequences vary depending on which files are listed and accessible.</p>\r\n                    <p>Therefore, it is important to protect your directories by having an empty index.php or index.htm file inside them.</p>', '', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(19, 0, 2, 'check_index_wp_uploads', 'The <strong>"index.php"</strong> file was not found in the <strong>"/wp-content/uploads"</strong> directory', '<p>A directory listing provides an attacker with the complete index of all the resources located inside of the directory. The specific risks and consequences vary depending on which files are listed and accessible.</p>\r\n                        <p>Therefore, it is important to protect your directories by having an empty index.php or index.htm file inside them.</p>', '<p>This plugin can automatically create an empty <strong>"index.php"</strong> file in the following directories: wp-content, wp-content/plugins, wp-content/themes and wp-content/uploads if the\r\n                        option <strong>"Try to create the index.php file in the wp-content, wp-content/plugins, wp-content/themes and wp-content/uploads directories to prevent directory listing"</strong> is checked on the plugin''s settings page.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(20, 0, 2, 'check_htaccess_wp_admin', 'The <strong>".htaccess"</strong> file was not found in the <strong>"wp-admin"</strong> directory', '<p>An .htaccess file is a configuration file which provides the ability to specify configuration settings for a specific directory in a website.\r\n                    The .htaccess file can include one or more configuration settings which apply only for the directory in which the .htaccess file has been placed.\r\n                    So while web servers have their own main configuration settings file, the .htaccess file can be used to override their main configuration settings.</p>', '<p>Please refer to this <a href="http://www.acunetix.com/blog/web-security-zone/articles/what-is-an-htaccess-file/" target="_blank">article</a> for more information on how to create an .htaccess file.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(21, 0, 2, 'check_readme_wp_root', 'The <strong>readme.html</strong> file was found in the root directory', '<p>A default WordPress installation contains a readme.html file.\r\n                                This file is a simple html file that does not contain executable content that can be exploited by hackers or malicious users.\r\n                                Still, this file can provide hackers the version of your WordPress installation, therefore it is important to either delete this file or make it inaccessible for your visitors.</p>', '<p>This plugin can automatically delete its content if the option <strong>"Empty the content of the readme.html file from the root directory."</strong> is checked on the plugin''s settings page.\r\n                                You can also delete this file manually by connecting to your website through an FTP connection.</p>', '2013-09-26 17:07:28', '2013-09-26 11:29:53'),
(22, 0, 3, 'check_username_admin ', 'The default user <strong>"admin"</strong> was found', '<p>One well known and dangerous WordPress security vulnerability is User Enumeration, in which a malicious user is able to enumerate\r\n                            a valid WordPress user account to launch a brute force attack against it.</p>\r\n                            <p>In order to help deter this type of attack, you should change your default <a href="http://www.acunetix.com/blog/web-security-zone/articles/default-wordpress-administrator-account/" target="_blank">WordPress administrator</a>\r\n                            username to something more difficult to guess.</p>', '<p>Do not make the following change unless you are comfortable working with PHPMyAdmin and MySQL. If not, ask someone who is familiar with WordPress and MySQL to assist you. </p>\r\n                            <p>Also, it is of utmost importance to backup your whole blog - including the database - before making any of the changes described below.</p>\r\n                            <p>To change your WordPress default admin username, navigate to your web host''s MySQL administration tool (probably PHPMyAdmin) and browse to your WordPress database.\r\n                            Locate the users table, in which you will find a user_login column. One of the rows will contain admin in the field.\r\n                            Change this to a complex and hard-to-guess name, which ideally consists of alpha-numeric characters.</p>\r\n                            <p><strong>IMPORTANT:</strong> Even if the username is hard to guess, you will still need a very strong password.</p>', '2013-09-26 11:29:54', '2013-09-26 11:29:54');
